window.bookSummaryJSON = "<p>Audible Originals takes to the high seas to bring to life this timeless tale of pirates, lost treasure maps and mutiny, starring Catherine Tate (BAFTA-nominated, <i>The Catherine Tate Show</i>, <i>The Office</i>, <i>Doctor Who</i>), Philip Glenister (<i>Outcast</i>, <i>Life On Mars</i>), Owen Teale (<i>Game of Thrones</i>, <i>Pulse</i>, <i>Last Legion</i>) and Daniel Mays (<i>The Adventures of Tintin</i>, <i>Rogue One</i>, <i>Atonement</i>) amongst others.</p> <p>Featuring: Stephen Critchlow, James Doherty, Philip Glenister, Peter Gold, Ed Harrison, David Holt, Gerran Howell, Matthew Jure, Daniel Mays, Gerard McDermott, Paul McEwan, Harry Myers, Greg Page, Richard Reed, Mark Straker, Catherine Tate, Owen Teale and Ben Whitehead.</p>"; 
